import React, { Component, Fragment } from 'react';
import { Row } from 'antd';
import bg from './../../asset/images/gradient-linear-blue-purple-1920x1080-c2-00bfff-9400d3-a-90-f-14.png'

class sider extends Component {
    constructor(props) {
        super(props);
        this.state = {  };
    }
    render() {
        // const {onClickProfile} = this.props;
        
        return (
            <Fragment>
            <div style={{backgroundImage: `url(${bg})`, height: '100%', borderRadius: '20px', margin: '10', paddingTop:'100%', paddingBottom:'100%', paddingLeft:'40px', paddingRight:'40px'}}>
            <div
            className="sid1"
             style={{height:'20%', borderBottom:'1px', borderBottomColor:'lightgray', borderBottomStyle:'solid', paddingBottom:'15px', paddingTop:'15px', color:'grey'}} 
            onClick={() => {
                  this.props.onClickProfile('Profile');
                }}>
            Profile
            </div>
            <div style={{height:'20%', borderBottom:'1px', borderBottomColor:'lightgray', borderBottomStyle:'solid', paddingBottom:'15px', paddingTop:'15px', color:'grey'}} 
             className="sid1"
            onClick={() => {
                this.props.onClickProfile('Posts');
              }}>
            Posts
            </div>
            <div style={{height:'20%', borderBottom:'1px', borderBottomColor:'lightgray', borderBottomStyle:'solid', paddingBottom:'15px', paddingTop:'15px', color:'grey'}}
             className="sid1"
            onClick={() => {
                this.props.onClickProfile('Gallery');
              }}>
            Gallery
            </div>
            <div style={{height:'20%', borderBottom:'1px', borderBottomColor:'lightgray', borderBottomStyle:'solid', paddingBottom:'15px', paddingTop:'15px', color:'grey'}}
             className="sid1"
            onClick={() => {
                this.props.onClickProfile('ToDo');
              }}>
            ToDo
            </div>
            </div>
            </Fragment>
        );
    }
}

export default sider;
